import React from 'react';
import PropTypes from 'prop-types';

import { Card, CardTitle, CardText, CardImg, CardImgOverlay } from 'reactstrap';

const Numbers = props => {
  return (
    <div>
      <Card
        inverse
        style={{
          boxShadow: ' 2px 6px 14px black',
          marginLeft: '0.5rem'
        }}
      >
        <CardImg
          height='100%'
          width='100%'
          src={require('../../img/c.jpg')}
          alt='Card image cap'
        />
        <CardImgOverlay>
          <CardTitle style={{ fontSize: '2.4rem', fontWeight: 'bolder' }}>
            פרסים
          </CardTitle>
          <CardText style={{ fontWeight: 'bolder' }} color='white' dir='rtl'>
            מעל 2500 פרסים חולקו החודש
          </CardText>
          <CardText>
            <small className='text-muted'>Last updated 3 mins ago</small>
          </CardText>
        </CardImgOverlay>
      </Card>
    </div>
  );
};
Numbers.propTypes = {};

export default Numbers;
